‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
"Meg here, this thing called family is the hardest thing I've ever done. It stretches me to the core. Most days it's WAY easier to come on here and write a social media post (that comes with comments and ‚ù§Ô∏è‚ù§Ô∏è‚ù§Ô∏è‚ù§Ô∏è‚ù§Ô∏è!!) instead of disciplining my children so they'll actually become good responsible human beings (and for the love... put down that toilet seat without being told!!).‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
/‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
There are days where I want to flee from BEING present with my kids. Days where it is easier to hide in the never ending tasks of maintaining a home. Why is that? Because it makes me feeeeeel accomplished. Because it's measurable.‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
/‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
It's taken me seven years of trying to make everybody happy to realize that parenting isn't measurable at all!! Not really. I mean yes we can check off facts and stats about our kids; Do they sleep through the night? Can they read? Do they get straight A's? Do they know how to order a Double Decker Taco (hello, life skills!!)?! But the only way we REALLY know if we are doing a good job is to stop and listen. We have to be willing to step back and observe what our children are really saying instead of assuming they want/need what everyone else says they should want/need or what our childhood says they should want/need! We have to slow down enough to listen to our own hearts and bodies to recognize when something feels off and to know when we are fleeing from the actual work of parenting.‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
/‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
